const QuattrocentoSansRegular = `@font-face { font-family: 'Quattrocento Sans'; font-style: normal; font-weight: 400; src: local('Quattrocento Sans'), local('QuattrocentoSans'), url('data:font/woff2;base64,') format('woff2'); }`;
const QuattrocentoSans700 = `@font-face { font-family: 'Quattrocento Sans'; font-style: normal; font-weight: 700; src: local('Quattrocento Sans Bold'), local('QuattrocentoSans-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
const QuattrocentoSansItalic = `@font-face { font-family: 'Quattrocento Sans'; font-style: italic; font-weight: 400; src: local('Quattrocento Sans Italic'), local('QuattrocentoSans-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const QuattrocentoSans700italic = `@font-face { font-family: 'Quattrocento Sans'; font-style: italic; font-weight: 700; src: local('Quattrocento Sans Bold Italic'), local('QuattrocentoSans-BoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
